import React from "react";
import { Link } from "react-router-dom";
import Note from "../../../Note/Note";
import "../inside-cave.css";

const LeftSide = () => {
  return (
    <div className="inside-cave-left-side--container">
      <Note
        paragraph="faktai apie mane"
        linkUrl="/inside-cave"
        notePostion={{
          margin: "0 6rem",
        }}
        marginValue={"0 6rem"}
      />
    </div>
  );
};

export default LeftSide;
